    #loader {
        margin-left: 100px;
        margin-top: 100px;
        width: 120px;
        height: 30px;
        display: flex;
        position: relative;
        align-items: center;
        justify-content: center;
    }

    .car {
        position: absolute;
        top: 0;
        left: -36px;
    }

    .car__body {
        position: absolute;
        top: 0;
        left: 0;
        -webkit-animation: shake 0.2s ease-in-out infinite alternate;
        animation: shake 0.2s ease-in-out infinite alternate;
    }
    .car__line {
        position: absolute;
        transform-origin: center right;
        stroke-dasharray: 22;
        -webkit-animation: line 0.8s ease-in-out infinite;
        animation: line 0.8s ease-in-out infinite;
        -webkit-animation-fill-mode: both;
        animation-fill-mode: both;
    }
    .car__line--top {
        position: absolute;
        top: 5px;
        left: -36px;
        -webkit-animation-delay: 0s;
        animation-delay: 0s;
    }
    .car__line--middle {
        position: absolute;
        bottom: 14px;
        -webkit-animation-delay: 0.2s;
        animation-delay: 0.2s;
        left: -57px;
    }
    .car__line--bottom {
        position: absolute;
        left: -42px;
        bottom: 5px;
        -webkit-animation-delay: 0.4s;
        animation-delay: 0.4s;
    }
    .car__wheel--left {
        position: absolute;
        top: 16px;
        left: 0;
        z-index: 2;
        animation: rotate 0.8s ease-in-out infinite;
    }
    .car__wheel--right{
        position: absolute;
        top: 16px;
        right: 36px;
        z-index: 2;
        animation: rotate 0.8s ease-in-out infinite;
    }
    .loader__text {
        position: absolute;
        bottom: -24px;
        left: 0;
        text-align: center;
        font-size: 12px;
        font-weight: bold;
    }

    @-webkit-keyframes shake {
        0% {
            transform: translateY(-1%);
        }
        100% {
            transform: translateY(3%);
        }
    }

    @-webkit-keyframes rotate {
        0% {
            transform: rotateZ(0deg);
        }
        25% {
            transform: rotateZ(90deg);
        }
        50% {
            transform: rotateZ(180deg);
        }
        75% {
            transform: rotateZ(270deg);
        }
        100% {
            transform: rotateZ(360deg);
        }
    }

    @keyframes shake {
        0% {
            transform: translateY(-1%);
        }
        100% {
            transform: translateY(3%);
        }
    }
    @-webkit-keyframes line {
        0% {
            stroke-dashoffset: 22;
        }
        25% {
            stroke-dashoffset: 22;
        }
        50% {
            stroke-dashoffset: 0;
        }
        51% {
            stroke-dashoffset: 0;
        }
        80% {
            stroke-dashoffset: -22;
        }
        100% {
            stroke-dashoffset: -22;
        }
    }
    @keyframes line {
        0% {
            stroke-dashoffset: 22;
        }
        25% {
            stroke-dashoffset: 22;
        }
        50% {
            stroke-dashoffset: 0;
        }
        51% {
            stroke-dashoffset: 0;
        }
        80% {
            stroke-dashoffset: -22;
        }
        100% {
            stroke-dashoffset: -22;
        }
    }
